import React from "react";
import { Radio } from "antd";

const radioStyle = {
  display: "block",
  height: "30px",
  lineHeight: "30px",
};

class Choices extends React.Component {
  render() {
    const { choices } = this.props;
    const { questionId } = this.props;
    const { usersAnswers } = this.props;
    console.log(choices);
    console.log(this.props.choices.choice_text);

    return (
      <Radio.Group
        onChange={(e, qId) => this.props.change(e, questionId)}
        value={
          usersAnswers[questionId] !== undefined &&
          usersAnswers[questionId] !== null
            ? usersAnswers[questionId]
            : null
        }
      >
        {choices.choice_text.map((c, index) => {
          return (
            <Radio style={radioStyle} value={c} key={index}>
              {c}
            </Radio>
          );
        })}
      </Radio.Group>
    );
  }
}

export default Choices;
